import React, { useState } from 'react';
import './pad.css';

const Pad = (props) => {
    const [data, setData] = useState({
        positions: new Array(9).fill(null)
    })

    let padButtons = null;
    padButtons = data.positions.map((number,index) => {
        if(index > 0){

            return index;
        }else{
            return null;
        }
    });



    return(
        <div className='padDesign'>
        {padButtons}
        </div>
    )
}
export default Pad;
